import React from 'react'
import { Link } from 'react-router-dom'



export const Home = () => {
    return (
        <div>
            <h1>Welcome to homepage</h1>
            <Link to="/register">Register</Link>
            <Link to="/signin">Sign In</Link>
        </div>
    )
}
